@JoyAnnReid I’m going for fluff now. So if you’re looking for something deep like The 7,this ain’t it.
I need a damn break from the sleepless &amp; sadness in the pit of my stomach and furiously endless rage.
So:The Boys, Hanna, Fleabag, I’m sorry, Jane the Virgin,Queen of the South.🤷🏼‍♀️
